import React from "react";
import { Fragment } from "react/cjs/react.production.min";
import './skills.css';

const SkillMeter=()=>{
    const skill_data=[
        {
            name:"HTML",
            level:"90%",
            color:"blue",
            id:"html"
        },
        {
            name:"CSS",
            level:"90%",
            color:"purple",
            id:"css"
        },
        {
            name:"JavaScript",
            level:"70%",
            color:"yellow",
            id:"Js"
        },
        {
            name:"ReactJs",
            level:"60%",
            color:"red",
            id:"Rjs"
        },
        {
            name:"Redux",
            level:"65%",
            color:"blue",
            id:"redux"
        },
        {
            name:"Router",
            level:"50%",
            color:"green",
            id:"router"
        }
    ];
return(
    <Fragment>
        <div className="container">
            <div className="circular-progress" style={{background:`conic-gradient(orange ${50*3.6}deg,#cadcff ${50*3.6}deg)`}}>
                <div className="value_container"><p className="level">{`${skill_data[0].name}`}</p>
                <p className="level">{`${skill_data[0].level}`}</p></div>
            </div>
        </div>
    </Fragment>
);
};

export default SkillMeter;
